/* eslint-disable jsx-a11y/label-has-associated-control */
/* eslint-disable jsx-a11y/label-has-for */
/* eslint-disable react/destructuring-assignment */
/* eslint-disable react/sort-comp */
import React, { Component } from 'react';
// import ReactDOM from 'react-dom';
import FusionCharts from 'fusioncharts';
import Charts from 'fusioncharts/fusioncharts.charts';
import ReactFC from 'react-fusioncharts';
import FusionTheme from 'fusioncharts/themes/fusioncharts.theme.fusion';
import {
  Row,
  Col,
  FormSelect,
  Card,
  CardHeader,
  CardBody,
  CardFooter
} from 'shards-react';

ReactFC.fcRoot(FusionCharts, Charts, FusionTheme);

const chartConfigs = {
  type: 'column2d',
  width: "100vh",
  height: "100%",
  dataFormat: 'json',
  dataSource: {
    chart: {
      // caption: 'Recommended Portfolio Split',
      //  subCaption: 'For a net-worth of $1M',
      showValues: '1',
      showPercentInTooltip: '0',
      numberPrefix: '$',
      enableMultiSlicing: '1',
      theme: 'fusion'
    },
    data: [
      {
        label: 'Equity',
        value: '300000'
      },
      {
        label: 'Debt',
        value: '230000'
      },
      {
        label: 'Bullion',
        value: '180000'
      },
      {
        label: 'Real-estate',
        value: '270000'
      },
      {
        label: 'Insurance',
        value: '20000'
      }
    ]
  }
};

class ChartsExemple extends Component {
  constructor(props) {
    super(props);

    this.state = {
      chart: {},
      currentVal: 'column2d'
    };

    this.renderComplete = this.renderComplete.bind(this);
    this.radioHandler = this.radioHandler.bind(this);
  }

  renderComplete(chart) {
    this.setState({ chart });
  }

  // Handler for radio buttons to change chart type.
  radioHandler(e) {
    this.state.chart.chartType(e.currentTarget.value);
    this.setState({
      currentVal: e.currentTarget.value
    });
  }

  render() {
    return (
      <Card small className="h-100">
        <CardHeader className="border-bottom">
          <h6 className="m-0">DAC Data</h6>
        </CardHeader>
        <br />
        <br />
        <br />
        <CardBody className="d-flex py-0">
          <div>
            <br />
            <br />
            <br />
            <ReactFC {...chartConfigs} onRender={this.renderComplete} />
            <br />
          </div>
        </CardBody>
        <CardFooter className="border-top">
          <Row>
            <Col>
              <FormSelect
                size="sm"
                value="last-week"
                style={{ maxWidth: '130px' }}
                onChange={() => {}}
              >
                <option value="last-week">Last Week</option>
                <option value="today">Today</option>
                <option value="last-month">Last Month</option>
                <option value="last-year">Last Year</option>
              </FormSelect>
            </Col>
            <Col className="text-right view-report">
              <center>
                <span>Choose a chart type:</span>
                <div className="change-type">
                  <div>
                    <input
                      type="radio"
                      value="column2d"
                      onChange={this.radioHandler}
                      checked={this.state.currentVal === 'column2d'}
                    />
                    <label>Column 2D Chart</label>
                  </div>
                  <div>
                    <input
                      type="radio"
                      value="bar2d"
                      onChange={this.radioHandler}
                      checked={this.state.currentVal === 'bar2d'}
                    />
                    <label>Bar 2D Chart</label>
                  </div>
                  <div>
                    <input
                      type="radio"
                      value="pie2d"
                      onChange={this.radioHandler}
                      checked={this.state.currentVal === 'pie2d'}
                    />
                    <label>Pie 2D Chart</label>
                  </div>
                </div>
              </center>
            </Col>
          </Row>
        </CardFooter>
      </Card>
    );
  }
}

// ReactDOM.render(<Chart />, document.getElementById('root'));

export default ChartsExemple;
